INSERT INTO reviews (nama_pengulas, rating_bintang, teks_ulasan, topik_utama, sentimen, nama_cafe) VALUES ('frengky kaiway', 4.0, 'At Warung Kopi 57 Parepare, there are a lot of people, including muda, tua, and bersantai children. They sell more than just coffee; they also sell food and minuman, with asyik and enak as their pokok.', 'Coffee', 'Positif', 'R57');
INSERT INTO reviews (nama_pengulas, rating_bintang, teks_ulasan, topik_utama, sentimen, nama_cafe) VALUES ('Nuraisyah  Pertiwi K', 4.0, 'Just randomly stopped here on the way from Makassar - Palopo, it turns out the Teh Tarik is delicious! As someone who doesn''t really like sweets, order Teh Tarik with less sugar, it''s just the right amount of sweetnessüò≠üò≠ Hero coffee is also approved by Swamiüôèüèºüòá My 1st message for the cashier today because it''s still early in the morning I''m so dazed huhu, my male work partner also asked for best seller tea, instead he answered all the types of tea on the menu, I can read it myself too if that''s the caseü•≤ so I chose the one first he just said wow, it''s a shame for a cafe this good but the waiters are grumpy even though it''s still early, they should still be enthusiasticüî•üòä', 'Coffee', 'Positif', 'R57');
INSERT INTO reviews (nama_pengulas, rating_bintang, teks_ulasan, topik_utama, sentimen, nama_cafe) VALUES ('masita nonci', 5.0, 'Hangout place, strategic location. Delicious food. Friendly baristas', 'Food', 'Positif', 'R57');
INSERT INTO reviews (nama_pengulas, rating_bintang, teks_ulasan, topik_utama, sentimen, nama_cafe) VALUES ('Akhrianto (anto)', 5.0, 'Masyaa Allah, the place is nice, V60 coffee is available, the atmosphere is great, and most importantly there is a prayer room, barakallah', 'Coffee', 'Positif', 'R57');
INSERT INTO reviews (nama_pengulas, rating_bintang, teks_ulasan, topik_utama, sentimen, nama_cafe) VALUES ('Tirza Mahardani', 5.0, 'I think this is one of the coolest cafes in Pare-Pare. Their bottled signature coffee is quite delicious, their lychee tea too. The fried banana is also delicious, and actually I was a bit surprised when I was given fried banana with 2 dips, chili sauce and sugar butter. This is the first time I''ve found a cafe that gives margarine/butter+sugar to make fried banana dipping sauce. As for the price, I think it''s standard coffee shop.
INSERT INTO reviews (nama_pengulas, rating_bintang, teks_ulasan, topik_utama, sentimen, nama_cafe) VALUES ('kaki panjang ', 5.0, 'One of the best cafe shops in Pare Pare in my opinion. The architecture of the exterior and interior is definitely cool with views that are no less pleasing to the eye. Each space is used with its own function. The interior is also mevvah for the middle class city class. Great. Good luck!', 'Chill', 'Positif', 'R57');
INSERT INTO reviews (nama_pengulas, rating_bintang, teks_ulasan, topik_utama, sentimen, nama_cafe) VALUES ('iyalagi', nan, 'After visiting several times, I think there is one thing that bothers me (which happens to happen a lot in other cafes in Parepare) namely smoking/vaping in the air-conditioned room. The employees should be more assertive and aware that smoking/vaping has many negative impacts, bro (please try google). I hope that the comfort of the cafe can be improved. the rest is that the food and service are still consistently good.', 'Food', 'Positif', 'R57');
INSERT INTO reviews (nama_pengulas, rating_bintang, teks_ulasan, topik_utama, sentimen, nama_cafe) VALUES ('yuliana rahmawati', 4.0, 'Cafe with an Unfinished style concept. The place is comfortable, supported by fairly fast wifi.
INSERT INTO reviews (nama_pengulas, rating_bintang, teks_ulasan, topik_utama, sentimen, nama_cafe) VALUES ('dewi kultsum', 4.0, 'Don''t worry, friendly service is just normal. In the air-conditioned room there were people smoking vapes, only once. Next there is none. The best place if you want to work while drinking coffee üëçüëç', 'Coffee', 'Positif', 'R57');
INSERT INTO reviews (nama_pengulas, rating_bintang, teks_ulasan, topik_utama, sentimen, nama_cafe) VALUES ('Emm', 3.0, 'A relatively new hangout place on Jalan Jend Sudirman Pare-pare.
INSERT INTO reviews (nama_pengulas, rating_bintang, teks_ulasan, topik_utama, sentimen, nama_cafe) VALUES ('Annie Niezt', 1.0, 'The cafe is good, only the human resources of the employees need to be improved, it''s very annoying to have a drink at the barista''s place, 2-3 people at the same time serving, you know, it''s quite sad to see, hopefully the owner can fix it', 'Umum', 'Negatif', 'R57');
INSERT INTO reviews (nama_pengulas, rating_bintang, teks_ulasan, topik_utama, sentimen, nama_cafe) VALUES ('Syihab MS', 4.0, 'The location is good, the service is okay. Parking is spacious', 'Umum', 'Positif', 'R57');
INSERT INTO reviews (nama_pengulas, rating_bintang, teks_ulasan, topik_utama, sentimen, nama_cafe) VALUES ('Nurul fifra Ramadhan', 5.0, 'I decided to get out of my comfort zone by daring to hang out alone (I''m an introvert), then suddenly I got catcalled so much that it made me uncomfortable. After the person left, a waitress came over and apologized twice for the person''s behavior. I don''t know what her name is but this is all I can say, she made me calm before I cried my eyes out haha, thank you so much sis! sure i''ll choose this place whenever i feel like getting out of my comfort zone again.', 'Alone', 'Positif', 'R57');
INSERT INTO reviews (nama_pengulas, rating_bintang, teks_ulasan, topik_utama, sentimen, nama_cafe) VALUES ('Ashari Lubis', 5.0, 'The atmosphere is very comfortable, with good facilities
INSERT INTO reviews (nama_pengulas, rating_bintang, teks_ulasan, topik_utama, sentimen, nama_cafe) VALUES ('Agry Caesar', 4.0, 'the place on the side of the road is very pleasing to the eye, a trendy place to hang out, the food and drinks are delicious, btw the 2nd floor AC is not cold enough, please fix it, the rest is ok', 'Chill', 'Positif', 'R57');
