INSERT INTO reviews (nama_pengulas, rating_bintang, teks_ulasan, topik_utama, sentimen, nama_cafe) VALUES ('Nurfajri Atira', 5.0, 'Really cool place. Comfy. Very suitable for work assignments and casual discussions with friends. There are also reading books (novels) in the bookcase. Feel free to read as long as you don''t wrap it up and take it home hehe. Best!', 'Group', 'Positif', 'R57');
